import React from "react";
import { Form, FormGroup, Row, Col, Container } from 'reactstrap';
import { FormControl, InputLabel, Select, MenuItem, TableContainer } from "@material-ui/core";
import MenuSuperior from "../menuSuperior/MenuSuperior";

import { withStyles, makeStyles } from '@material-ui/core/styles';
import { Button } from "@material-ui/core";
import Table, { classes } from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles((theme) => ({
    head: {
        backgroundColor: theme.palette.common.blue,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
    root: {
        '&:nth-of-type(odd)': {
            backgroundColor: theme.palette.action.hover,
        },
    },
}))(TableRow);

const checkpromo = (props) => {
    return (
        <div>
            <MenuSuperior />
            <Container>
                <Form >
                    <Row>
                        <Col sm={4} md={4} xl={4} lg={4}>
                            <FormGroup>
                                <FormControl>
                                    <InputLabel id="select-label">Buscar</InputLabel>
                                    <Select
                                        labelId="select-label"
                                        id="select"
                                    >
                                        <MenuItem selected disabled value="">Selecione Opção</MenuItem>
                                        <MenuItem value=""></MenuItem>
                                    </Select>
                                </FormControl>
                            </FormGroup>
                            <Button color="primary">Filtrar</Button>{' '}
                        </Col>
                    </Row>
                </Form>
            </Container>
            <Container>
                <Form id="altura">
                    <Row>
                        <Col>
                            <Button color="primary">Consultas</Button>{' '}
                        </Col>
                    </Row>
                    <Row>
                        <Col sm={4} md={6} xl={8} lg={6}>
                            <FormGroup>
                                <FormControl>
                                    <InputLabel id="select-label">Tipos de Consulta</InputLabel>
                                    <Select
                                        labelId="select-label"
                                        id="select"
                                    >
                                        <MenuItem selected disabled value="">Selecione Opção</MenuItem>
                                        <MenuItem value=""></MenuItem>
                                    </Select>
                                </FormControl>
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <Table >
                            <TableHead className="tabela">
                                <TableRow>
                                    <StyledTableCell>Consultas</StyledTableCell>
                                    <StyledTableCell></StyledTableCell>
                                    <StyledTableCell></StyledTableCell>
                                    <StyledTableCell></StyledTableCell>
                                    <StyledTableCell></StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody></TableBody>
                        </Table>
                    </Row>
                </Form>
            </Container>
        </div>
    );
}
export default checkpromo;
